import React from 'react';

import './styles/Header.css';
import peopleLogo from '../images/logo.svg'

class Header extends React.Component {
    render () {
        return (
            <div className="header__logo">
                <div className="logo">
                    <img src={peopleLogo} ></img>
                </div>              
            </div>
            )
    }
}

export default Header;
